script: |
  super -f text -I q7066.spq | sort > q7066.out

inputs:
  - name: q7066.spq
    data: |
      SELECT - cor0.col0 / - col1 + - ( - cor0.col2 ) * + col2 + ( + ( col1 ) * col1 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q7066.out
    data: |
      3355
      3592
      9391
